import { View, Text } from 'react-native'
import React from 'react'

const Navbar = () => {
    return (
        <View>
            <Text>Navbar</Text>
        </View>
    )
}

const style = StyleSheet.create({
    container: {
        marginTop: 10,
        backgroundColor:"#0000"
    }
})



export default Navbar
